import React from 'react'
import { useEffect, useState } from 'react';
import "./Contact.css";
import axios from 'axios';
import { Container, Row } from 'react-bootstrap';
import Col from 'react-bootstrap/Col';
import { Button } from 'react-bootstrap';
import Form from 'react-bootstrap/Form';





const Contact = () => {

    const [show, setShow] = useState(false);
    const [product, setProduct] = useState([])
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [price, setPrice] = useState("");
    const [variant, setVariant] = useState("");
    const [id, setId] = useState("");

    useEffect(() => {
        getProduct();
    }, [])

    const getProduct = () => {
        axios.get('http://localhost:5002/notes')
            .then((res) => {
                setProduct(res.data.data);
                // console.log(res.data.data);
            })
    }
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    return (
        <>
            <Button variant="primary" className='btn-1' onClick={handleShow}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-plus" viewBox="0 0 16 16">
                    <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4" />
                </svg>
            </Button>
            <Container show={show} onHide={handleClose}>
                <Row>
                    <Col className=' pt-5'>
                        <div className='ms-5'>
                            <h2 className='pine'>Contact Us</h2>
                        </div>
                        <div class="card border p-4 shadow contact-x">

                            <div class="mb-3">
                                <label for="exampleFormControlInput1">Full Name</label>
                                <input type="text" class="form-control username" id="exampleFormControlInput1" placeholder="Enter Full Name" />
                            </div>
                            <div class="mb-3">
                                <label for="exampleFormControlInput1">Email address</label>
                                <input type="email" class="form-control email" id="exampleFormControlInput1" placeholder="Enter Email Address" />
                            </div>
                            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
                                <Form.Label>Example textarea</Form.Label>
                                <Form.Control as="textarea" rows={3} />
                            </Form.Group>
                            <div class="form-check">
                                <input class="form-check-input" type="checkbox" id="flexCheckIndeterminate" />
                                <label class="form-check-label" for="flexCheckIndeterminate">
                                    Terms & Condition
                                </label>
                            </div>
                            <div class="mt-4">
                                <Button variant="outline-secondary" className='rounded-pill btn-change'>Submit</Button>
                            </div>
                        </div>

                    </Col>
                </Row>
            </Container>




        </>
    )
}

export default Contact;
